namespace _0005_longest_palindromic_substring;

public class SolutionTests
{
    [Fact]
    public void Test1()
    {
        var sln = new Solution1();

        var result = sln.LongestPalindrome("babad");

        Assert.Equal("aba", result);
    }

    [Fact]
    public void Test2()
    {
        var sln = new Solution1();

        var result = sln.LongestPalindrome("cbbd");

        Assert.Equal("bb", result);
    }

    [Fact]
    public void Test3()
    {
        var sln = new Solution1();

        var result = sln.LongestPalindrome("babaddtattarrattatddetartrateedredividerb");

        Assert.Equal("ddtattarrattatdd", result);
    }

    [Fact]
    public void Test4()
    {
        var sln = new Solution1();

        var result = sln.LongestPalindrome("");

        Assert.Equal("qahaq", result);
    }

    [Fact]
    public void Test5()
    {
        var sln = new Solution1();

        var result = sln.LongestPalindrome("");

        Assert.Equal("", result);
    }
}
